snippet.sync_client:
package com.example.usage;

import com.seed.api.SeedApiClient;
import com.seed.api.requests.ItemData;

public class Example {
    public static void main(String[] args) {
        SeedApiClient client = SeedApiClient
            .builder()
            .build();

        client.createItem(
            "key",
            "value",
            ItemData
                .builder()
                .data("data")
                .build()
        );
    }
}

